import {Component, OnInit} from '@angular/core';
import {AuthService} from "../../service/auth.service";
import {UsersLogInfo} from "../../interfaces/userLoing.interface";

@Component({
    selector: 'app-home',
    templateUrl: './home.component.html',
    styleUrls: ['./home.component.sass']
})
export class HomeComponent implements OnInit {
    user: Array<UsersLogInfo> = [];
    constructor(public authService: AuthService) {
        console.log( this.authService.authInfo$);
    }

    ngOnInit(): void {
    this.authService.authInfo$.subscribe((email) => this.user = email  )

    }

}
<p>
    <mat-toolbar>
        <mat-toolbar-row>
            <span>home works! {{ authService.authInfo$| async | json}}</span>
            <span class="example-spacer"></span>
            <button mat-icon-button class="example-icon favorite-icon" aria-label="Example icon-button with heart icon">
            </button>
        </mat-toolbar-row>
    </mat-toolbar>
</p>
